import React, {useEffect, useState} from 'react';

export const EmptyWaitingListIcon = (props) => {
    const [logoDimention, setLogoDimention] = useState({width: '16', height: '16'});
 
    useEffect(() => {
       window.addEventListener('load', () => {
           if(window.innerWidth >= 1024){
               let width = window.innerWidth * (10/100);
               let height = window.innerHeight * (10/100);
   
               setLogoDimention({width, height});
           }
       });

       return () => window.removeEventListener('load', () => {
           if(window.innerWidth >= 768){
               let width = window.innerWidth * (10/100);
               let height = window.innerHeight * (10/100);
   
               setLogoDimention({width, height});
           }
       });
   }, []) 

   
    return (
        <svg width="123" height="123" viewBox="0 0 123 123" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
<circle cx="61.5" cy="61.5" r="61.5" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image0" transform="translate(-0.166667) scale(0.000833333)"/>
</pattern>
<image id="image0" width="1600" height="1200" xlinkHref="data:image/png;base64,"/>
</defs>
</svg>


    );
};